import React, { useState } from 'react';
import './App.css';

const App = () => {
  const [formData, setFormData] = useState({
    name: '',
    email: '',
    id: '',
    password: '',
    passwordRe: '',
    phoneNumber: '',
    birthday: '',
    gender: '',
    address: {
      zipCode: '',
      mainAddress: '',
      detailAddress: '',
    },
  });

  const handleChange = (e) => {
    const { name, value } = e.target;

    if (name.includes('address.')) {
      const addressKeys = name.split('.');
      setFormData((prevFormData) => ({
        ...prevFormData,
        address: {
          ...prevFormData.address,
          [addressKeys[1]]: value,
        },
      }));
    } else {
      setFormData({
        ...formData,
        [name]: value,
      });
    }
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log('회원가입 폼 데이터:', formData);
    // 여기에서 데이터를 서버로 보낼 수 있습니다. (추가 작업이 필요)
  };

  return (
    <div className="app-container">
      <h1>React 회원가입</h1>
      <form onSubmit={handleSubmit}>
        <table>
          <tbody>
            <tr>
              <th>이름:</th>
              <td>
                <input
                  type="text"
                  name="name"
                  value={formData.name}
                  onChange={handleChange}
                />
              </td>
              <th>이메일:</th>
              <td>
                <input
                  type="email"
                  name="email"
                  value={formData.email}
                  onChange={handleChange}
                />
              </td>
            </tr>
            <tr>
              <th>아이디:</th>
              <td>
                <input
                  type="text"
                  name="id"
                  value={formData.id}
                  onChange={handleChange}
                />
              </td>
              <th>비밀번호:</th>
              <td>
                <input
                  type="password"
                  name="password"
                  value={formData.password}
                  onChange={handleChange}
                />
              </td>
            </tr>
            <tr>
              <th>비밀번호 확인:</th>
              <td>
                <input
                  type="password"
                  name="passwordRe"
                  value={formData.passwordRe}
                  onChange={handleChange}
                />
              </td>
              <th>휴대전화 번호:</th>
              <td>
                <input
                  type="tel"
                  name="phoneNumber"
                  value={formData.phoneNumber}
                  onChange={handleChange}
                />
              </td>
            </tr>
            <tr>
              <th>생년월일 및 성별:</th>
              <td colSpan="3">
                <input
                  type="text"
                  name="birthday"
                  placeholder="생년월일"
                  value={formData.birthday}
                  onChange={handleChange}
                />
                <select
                  name="gender"
                  value={formData.gender}
                  onChange={handleChange}
                >
                  <option value="">선택하세요</option>
                  <option value="male">남성</option>
                  <option value="female">여성</option>
                </select>
              </td>
            </tr>
            <tr>
              <th>주소:</th>
              <td colSpan="3">
                <input
                  type="text"
                  name="address.zipCode"
                  placeholder="우편번호"
                  value={formData.address.zipCode}
                  onChange={handleChange}
                />
                <input
                  type="text"
                  name="address.mainAddress"
                  placeholder="주소"
                  value={formData.address.mainAddress}
                  onChange={handleChange}
                />
                <input
                  type="text"
                  name="address.detailAddress"
                  placeholder="상세 주소"
                  value={formData.address.detailAddress}
                  onChange={handleChange}
                />
              </td>
            </tr>
          </tbody>
        </table>
        <button type="submit">회원가입</button>
      </form>
    </div>
  );
};

export default App;
